geregisseerd door Frank Coraci
met Kevin James, de stemmen van Sylvester Stallone en Adam Sandler

'The Zookeeper' vertelt het verhaal over de goedaardige dierenverzorger Griffin Keyes (Kevin James), 
die ervan overtuigd is dat hij ontslag zal moeten nemen om zijn droomvrouw te vinden. 
De beesten uit de dierentuin vinden dit maar niks, raken in paniek en besluiten om Griffin te adviseren, i
n de hoop dat hij het meisje van zijn dromen (Leslie Bibb) verovert en toch voor de dierentuin kan blijven werken.

Storyline

A group of zoo animals decide to break their code of silence in order to help their lovable zoo keeper find love -- without opting to leave his current job for something more illustrious.

'The Zookeeper' tells the story of the benign zookeeper Griffin Keyes (Kevin James), 
who is convinced that he will resign to take his dream woman to find. 
The animals from the zoo, but nothing like this, panic and decide to advise Griffin, i 
n the hope that the girl of his dreams (Leslie Bibb) and yet captures the zoo can continue working.

